import React, { Component } from "react";
import SearchLanding from "./SearchLanding";

class Search extends Component {

    constructor(){
        super();
        this.state = {
          nonProfitName: "",
          nonProfitState: "",
          nonProfitCategory: "",
          pageSize: "",
          nonProfitRes: []
        }
    }

    render(){
        return(
            <div>
                <SearchLanding/>
            </div>
        )
    }
}

export default Search;
